const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const formatMessage = require('format-message');
const {loadCostume} = require('../../import/load-costume.js');
const SvgRenderer = require('scratch-svg-renderer');

/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
// const blockIconURI = 'data:image/svg+xml;base64,';
const blockIconURI = 'data:image/png;base64,';
const menuIconURI = blockIconURI;

save_parent = "";
save_child = "";

/**
 * States the PiCamera sensing activity can be set to.
 * @readonly
 * @enum {string}
 */
const PiCameraState = {
    /** PiCamera turned off. */
    OFF: 'off',

    /** PiCamera turned on with default y axis mirroring. */
    ON: 'on',

    /** PiCamera turned on without default y axis mirroring. */
    ON_FLIPPED: 'on-flipped'
};


class Scratch3HelloBlocks {
    constructor (runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;
        this.globalPiCameraState = PiCameraState.OFF;
		save_parent = document.body.getElementsByClassName("stage_monitor-wrapper_2hZ-i");
		save_child = save_parent[0].innerHTML;
    }


    /**
     * The key to load & store a target's pen-related state.
     * @type {string}
     */
    static get STATE_KEY () {
        return 'Scratch.helloWorld';
    }

    /**
     * The PiCamera state of the PiCamera preview stored in a value accessible by any
     * object connected to the virtual machine.
     * @type {number}
     */
    get globalPiCameraState () {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            return stage.PiCameraState;
        }
        // Though the default value for the stage is normally 'on', we need to default
        // to 'off' here to prevent the PiCamera device from briefly activating
        // while waiting for stage targets to be installed that say it should be off
        return PiCameraState.OFF;
    }

    set globalPiCameraState (state) {
        const stage = this.runtime.getTargetForStage();
        if (stage) {
            stage.PiCameraState = state;
        }
        return state;
    }

    /**
     * States the PiCamera sensing activity can be set to.
     * @readonly
     * @enum {string}
     */
    static get PiCameraState () {
        return PiCameraState;
    }


    /**
     * An array of info on PiCamera state options for the "turn PiCamera [STATE]" block.
     * @type {object[]}
     * @param {string} name - the translatable name to display in the PiCamera state menu
     * @param {string} value - the serializable value stored in the block
     */
    get PICAMERA_STATE_INFO () {
        return [
            {
                name: formatMessage({
                    id: 'picameraSensing.off',
                    default: 'off',
                    description: 'Option for the "turn picamera [STATE]" block'
                }),
                value: PiCameraState.OFF
            },
            {
                name: formatMessage({
                    id: 'picameraSensing.on',
                    default: 'on',
                    description: 'Option for the "turn picamera [STATE]" block'
                }),
                value: PiCameraState.ON
            },
            {
                name: formatMessage({
                    id: 'PiCameraSensing.onFlipped',
                    default: 'on flipped',
                    description: 'Option for the "turn PiCamera [STATE]" block that causes the PiCamera to be flipped' +
                        ' horizontally (reversed as in a mirror)'
                }),
                value: PiCameraState.ON_FLIPPED
            }
        ];
    }


    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo () {
        return {
            id: 'helloWorld',
            name: formatMessage({
                id: 'helloWorld.categoryName',
                default: 'hello World',
                description: 'Label for the hello world extension category'
            }),
            menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            // showStatusButton: true,
            blocks: [
                {
                    opcode: 'getCostumeImage',
                    // text: formatMessage({
                    //     id: 'mlforkidsImageData.imageblocks.getCostumeImage',
                    //     defaultValue: 'costume image'
                    // }),
                    text: 'costume image',
                    blockType: BlockType.REPORTER,
                    filter: ['sprite']
                },
                {
                    opcode: 'saveScreenshotToCostume',
                    // text: formatMessage({
                    //     id: 'mlforkidsImageData.imageblocks.saveScreenshotToCostume',
                    //     defaultValue: 'save screenshot to costume'
                    // }),
                    text: 'save screenshot to costume',
                    blockType: BlockType.COMMAND,
                    filter: ['sprite']
                },
                {
                    opcode: 'toggle',
                    blockType: BlockType.COMMAND,
                    text: formatMessage({
                        id: 'helloWorld.toggle',
                        default: 'toggle PiCamera [PICAMERA_STATE]',
                        description: 'toggle something'
                    }),
                    arguments: {
                        PICAMERA_STATE: {
                            type: ArgumentType.NUMBER,
                            menu: 'PICAMERA_STATE',
                            defaultValue: PiCameraState.OFF
                        }
                    }
                }
            ],
            menus: {
                PICAMERA_STATE: {
                    acceptReporters: true,
                    items: this._buildMenu(this.PICAMERA_STATE_INFO)
                }
            }
        };
    }

    _getImageAsJpeg (imagedata) {
        return new Promise(function (resolve) {
            var image = new Image();
            image.onload = function () {
                var canvas = document.createElement('canvas');
                console.log('[mlforkids] Resizing image to dimensions needed for classifying');
                canvas.width = 224;
                canvas.height = 224;

                var context = canvas.getContext('2d');
                context.fillStyle = "#FFFFFF";
                context.fillRect(0, 0, canvas.width, canvas.height);

                context.drawImage(image,
                                  0, 0, image.width, image.height,
                                  0, 0, canvas.width, canvas.height);

                var jpegdata = canvas.toDataURL('image/jpeg');
                if (jpegdata.indexOf('data:image/jpeg;base64,') === 0) {
                    jpegdata = jpegdata.substr('data:image/jpeg;base64,'.length);
                }
                resolve(jpegdata);
            };
            image.src = imagedata;
        });
    }

    _getStageCanvas () {
        var allCanvases = document.getElementsByTagName('canvas');
        for (var i = 0; i < allCanvases.length; i++) {
            var canvas = allCanvases[i];
            // if (canvas.className.startsWith('stage_stage_')) {
            if (canvas.width > 0 &&
                canvas.className.indexOf('paper-canvas_paper-canvas') === -1)
            {
                return canvas;
            }
        }
    }

    // Return the image data for a screenshot of the entire stage
    _getStageScreenshot() {
        // get the backdrop image
        this.runtime.renderer.draw();
        var originalCanvas = this._getStageCanvas();
        const WIDTH = originalCanvas.width;
        const HEIGHT = originalCanvas.height;

        // make a new off-screen canvas to copy to
        var copyCanvas = document.createElement('canvas');
        copyCanvas.width = WIDTH;
        copyCanvas.height = HEIGHT;
        var copyContext = copyCanvas.getContext('2d');

        // copy a section of the backdrop to the copy canvas
        copyContext.drawImage(originalCanvas, 0, 0, WIDTH, HEIGHT, 0, 0, WIDTH, HEIGHT);

        // return the canvas data
        const screenshot = copyCanvas.toDataURL('image/jpeg');
        return screenshot;
    }

    saveScreenshotToCostume (args, util) {
        const _storage = this.runtime.storage;
        const _runtime = this.runtime;
        const target = util.target;

        const BitmapAdapter = SvgRenderer.BitmapAdapter;
        const bitmapAdapter = new BitmapAdapter();

		//console.log(this._getStageScreenshot());
		imgdata = "data:image/png;base64,";
        return bitmapAdapter.importBitmap(imgdata, 'image/jpeg')
            .then((dataBuffer) => {
                const name = 'webcam';
                const type = _storage.AssetType.ImageBitmap;
                const dataFormat = _storage.DataFormat.JPG;

                const asset = _storage.createAsset(type, dataFormat, dataBuffer, null, true);

                const assetId = asset.assetId;
                const md5 = assetId + '.' + dataFormat;

                const costume = { name, dataFormat, asset, md5, assetId };

                return loadCostume(md5, costume, _runtime);
            })
            .then((costume) => {
                target.addCostume(costume);
                target.setCostume(target.getCostumes().length - 1);
            })
            .catch(e => {
                console.log('[mlforkids] Failed to save screenshot to costume');
                console.log(e);
            });
    }
	
    /**
     * Create data for a menu in scratch-blocks format, consisting of an array
     * of objects with text and value properties. The text is a translated
     * string, and the value is one-indexed.
     * @param {object[]} info - An array of info objects each having a name
     *   property.
     * @return {array} - An array of objects with text and value properties.
     * @private
     */
    _buildMenu (info) {
        return info.map((entry, index) => {
            const obj = {};
            obj.text = entry.name;
            obj.value = entry.value || String(index + 1);
            return obj;
        });
    }

    toggle (args, util) {
        const state = args.PICAMERA_STATE;
        this.globalPiCameraState = state;
        if (state === PiCameraState.OFF) {
			var img = document.createElement('img');
			img.src = 'http://5b0988e595225.cdn.sohucs.com/images/20180626/04bd6134fd6f4fae8593fb958c0e192d.jpeg';
			img.onload = function() {
				save_parent[0].innerHTML = '<div>' + img.outerHTML + '</div>' + save_child;
			}
		} else {
			save_parent[0].innerHTML = save_child;
		}
    }
}

module.exports = Scratch3HelloBlocks;
